var title_f2_49_2844="ACCP Rx bioprosthetic valve";
var content_f2_49_2844=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F64047&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F64047&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Ninth ed: ACCP evidence-based clinical practice guidelines: Antithrombotic therapy in patients with bioprosthetic heart valves",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"indent1\">",
"        <ul>",
"         <li>",
"          For the first three months after bioprosthetic mitral valve replacement (MVR),&nbsp;vitamin K antagonist (VKA) therapy (target INR, 2.5;range, 2.0-3.0)&nbsp;is suggested over no VKA therapy&nbsp;",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <ul>",
"         <li>",
"          For the first three months after surgical bioprosthetic aortic valve replacement (AVR) in patients who are in sinus rhythm and have no other indication for VKA therapy, aspirin (50 to 100 mg/day) is suggested over VKA therapy.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <ul>",
"         <li>",
"          For the first three months after transcatheter aortic&nbsp;bioprosthetic valve implantation, aspirin (50 to 100 mg/d) plus clopidogrel (75 mg/d) is suggested over VKA therapy and over no antiplatelet therapy.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <ul>",
"         <li>",
"          &nbsp;For the first three months after mitral valve repair with an annular ring in patients who are in sinus rhythm, antiplatelet therapy is suggested over VKA therapy.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <ul>",
"         <li>",
"          After the first three months&nbsp;following bioprosthetic&nbsp;valve replacement in patients&nbsp;in normal sinus rhythm,&nbsp;aspirin&nbsp;therapy is suggested&nbsp;over no&nbsp;aspirin therapy.&nbsp;",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <ul>",
"         <li>",
"          In patients undergoing aortic valve repair, aspirin (50 to 100 mg/d) is suggested over VKA therapy.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     <p>",
"      &nbsp;",
"     </p>",
"    </div>",
"    <div class=\"reference\">",
"     Data from Whitlock RP, Sun JC, Fremes SE, Rubens FD, Teoh KH. Antithrombotic and thrombolytic therapy for valvular disease: Antithrombotic Therapy and Prevention of Thrombosis, 9th ed: American College of Chest Physicians Evidence-Based Clinical Practice Guidelines.&nbsp;Chest. 2012;141:e576S.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
